    "2013-03-16T00:03:22.345991",nt"name": "review-of-the-subsurface-geology-and-resource-potential-of-southern-delaware",nt"isopen":
    false,nt"url": null,nt"notes": "Open file report on the subsurface geology
    and resource potential, focusing on the hydrocarbon, of southern Delaware for the
    nontechnical reader. This review summarizes the present knowledge of the subsurfacengeology
    and resource potential of southern Delaware and outlines the needs for future studies
    to gain further understanding of these matters. Because of the present interest
    in exploring for oil and gas beneath the Atlantic Outer Continental Shelf it is
    most timely that the primary resource considered in this report be the hydrocarbon
    (petroleum and natural gas) potential of the State. Hydrocarbons occur in commercial
    quantities only in thick sections of sedimentary rock, therefore, southern Delaware
    (primarily Sussex County) is the focus of this study because the thickest sedimentary
    rock section in the State is here. Assessment of the hydrocarbon potential of this
    area also has bearing on other resources such as groundwater (both fresh water and
    subsurface brines), underground storage of natural gas, and underground waste disposal.",nt"license_title":
